/* eslint-disable no-unused-vars */
import React, {useState} from "react";
import Card from "../card/Card";
import {
  Row,
  Col,
  FormGroup,
  FormLabel,
  FormControl,
  InputGroup,
  Button,
} from "react-bootstrap";
import Select from "react-select";
import {FaSearch, FaTimes} from "react-icons/fa";

const styles = {
  iconStyle: {
    cursor: "pointer",
  },
  rowStyle: {
    margin: "5px",
    padding: "5px",
    cursor: "pointer",
    fontSize: "15px",
    borderBottom: "1px solid grey",
  },
  searchDisabled: {
    pointerEvents: "none",
  },

  selectBoxStyle: {
    /* font-weight: bold !important; */
    color: "grey",
    border: "1px solid rgba(0, 0, 0, 0.05)",
    /* text-transform: uppercase; */
    background: "transparent",
    padding: "8px 8px",
    cursor: "pointer",
    margin: "2px",
  },
};

const SearchByKeyword = (props) => {
  const [user, setUser] = useState(props.user);
  const [filter, setFilter] = useState("");
  const [filteredData, setFilteredData] = useState([]);
  const [noMatchData, setNoMatchData] = useState([]);
  const [clicked, setClicked] = useState(false);
  const [selectedUsers, setSelectedUsers] = useState([]);
  const [checkCount, setCheckCount] = useState(0);
  const [checkboxValid, setCheckboxValid] = useState(false);
  const [submitted, setSubmitted] = useState(false);
  const [chosenCollection, setChosenCollection] = useState(null);
  const [chosenStewardUsage, setChosenStewardUsage] = useState(null);
  const [data, setData] = useState(props.db ? props.db : []);

  const stewardUsageOptions = [
    {value: "use", label: "Use"},
    {value: "publish", label: "Publish"},
  ];
  const componentWillReceiveProps = (newProps) => {
    if (newProps.db) {
      setData(newProps.db);
      setTimeout(() => {}, 50);
    }
  };

  const toTitleCase = (str) => {
    return str.replace(/\w\S*/g, (txt) => {
      return txt.charAt(0).toUpperCase() + txt.substr(1).toLowerCase();
    });
  };

  const responseToJson = (message, field) => {
    let convertedData = [];
    let data = message["Payload"][field];
    data.valuesList.forEach((row, index) => {
      let api = {};
      for (let i = 0; i < row.valuesMap.length; i++)
        api[row.valuesMap[i][0].toLowerCase()] = row.valuesMap[i][1];
      convertedData.push(api);
    });
    return convertedData;
  };

  const sendSearchForAgentsByKeywordRequest = (
    userName,
    domain,
    agentType,
    searchKeywordsArray,
    requestContext
  ) => {
    let filteredObj = [
      {
        agenttype: "Patron",
        designation: "Senior Analyst",
        displaypicture:
          "",
        displaypictureformat: "PNG",
        expertise: "Corporate Strategy",
        fullname: "Lijo Varghese",
        numpursuits: "20",
        organization: "Seqato",
        rating: "5",
        id: 1,
      },
      {
        agenttype: "Patron",
        designation: "Technology Architect",
        displaypicture:
          "",
        displaypictureformat: "PNG",
        expertise: "Technology Roadmapping",
        fullname: "Jeswin Johncy",
        numpursuits: "10",
        organization: "Seqato",
        rating: "5",
        id: 2,
      },
    ];
    setFilteredData([...data]);
    setNoMatchData([]);
    setTimeout(() => {
      if (filteredObj[0] != undefined) {
        setFilteredData([...filteredObj]);
        setClicked(true);
      } else {
        setNoMatchData([...noMatchData, filter]);
        setClicked(true);
      }
    }, 50);
  };
  const search = () => {
    sendSearchForAgentsByKeywordRequest(user, "Domain", "Patron", filter);
  };
  const handleChange = (event) => {
    setFilter(event.target.value);
  };
  const addUsersToSelected = (item, index, e) => {
    if (index.target.checked) {
      setCheckCount(checkCount + 1);
      setCheckboxValid(true);
    } else {
      setCheckCount(checkCount - 1);
      if (checkCount === 0) {
        setCheckboxValid(false);
      }
    }
    item.selected = index.target.checked;
    let temp = filteredData;
    temp[index] = item;
    setFilteredData(temp);
    filteredData.map((items, indexs) => {
      if (item.fullname == items.fullname) {
        items.selected = true;
      }
    });
  };

  const addAllUsersToSelected = (e) => {
    if (e.target.checked) {
      setCheckCount((prevCount) => prevCount + 1);
      setCheckboxValid(true);
    } else {
      setCheckCount((prevCount) => prevCount - 1);
      if (checkCount === 0) {
        setCheckboxValid(false);
      }
    }
    let temp = filteredData;
    for (let item of temp) {
      item.selected = e.target.checked;
    }
    setFilteredData(temp);
    if (filteredData.length != 0) {
      setIsChecked(true);
    }
  };

  const setStewardUsage = (value) => {
    let temp = filteredData;
    for (let item of temp) {
      if (item.selected) item.usage = value.value;
    }
    setFilteredData(temp);
    setChosenStewardUsage(value.value);
  };

  const generateFinalList = () => {
    const temp = [...data, ...filteredData];
    let unique = temp.filter((it, i, ar) => ar.indexOf(it) === i);
    let chosen = unique.filter((item) => item.selected == true);
    setData(unique);
    setClicked(false);
    setTimeout(() => {
      props.finalData(chosen);
    }, 50);
  };
  const clearResults = () => {
    setFilter("");
    setClicked(false);
    setFilteredData([]);
  };
  const [isChecked, setIsChecked] = useState(false);

  return (
    <div>
      <FormGroup>
        <InputGroup>
          <div className="hoverStyle input-group-addon" onClick={search}>
            <FaSearch className="search-icon" />

            {/* <i className="fa fa-search" style={styles.iconStyle}></i> */}
          </div>
          <FormControl
            placeholder="Search..."
            value={filter}
            type="text"
            className="mb"
            onChange={handleChange}
          />
          <div className="hoverStyle input-group-addon" onClick={clearResults}>
            <FaTimes className="times-icon" />
            {/* <i className="fa fa-times" style={styles.iconStyle}></i> */}
          </div>
        </InputGroup>
      </FormGroup>
      {clicked && (
        <div>
          <hr />
          <label>Results</label>
          <Card
            content={
              <div>
                {filteredData.length != 0 && (
                  <Row className="text-center" style={styles.rowStyle}>
                    <Col md={1}>
                      {" "}
                      <input
                        type="checkbox"
                        checked={isChecked}
                        onChange={addAllUsersToSelected}
                      />
                    </Col>
                    <Col md={1}> Name</Col>
                    <Col md={1}> Display Picture</Col>
                    <Col md={2}> Designation</Col>
                    <Col md={2}> Organization</Col>
                    <Col md={2}> Expertise</Col>
                    <Col md={2}>
                      {" "}
                      #Pursuits {user == "steward" ? "Stewarded" : "Patronized"}
                    </Col>
                    <Col md={1}> Rating</Col>
                  </Row>
                )}
                {filteredData.length != 0 &&
                  filteredData.map((item, index) => (
                    <Row
                      key={index}
                      className="text-center"
                      style={styles.rowStyle}
                    >
                      <Col md={1}>
                        {" "}
                        <input
                          type="checkbox"
                          checked={item.selected}
                          onChange={addUsersToSelected.bind(index, item)}
                        />
                      </Col>
                      <Col md={1}> {item.fullname}</Col>
                      <Col md={1}>
                        {" "}
                        <img
                          src={"data:image/png;base64," + item.displaypicture}
                          width="100%"
                        />
                      </Col>
                      <Col md={2}> {item.designation}</Col>
                      <Col md={2}> {item.organization}</Col>
                      <Col md={2}> {item.expertise}</Col>
                      <Col md={2}> {item.numpursuits}</Col>
                      <Col md={1}> {item.rating}</Col>
                    </Row>
                  ))}

                {filteredData.length != 0 && checkCount != 0 && (
                  <div>
                    {user == "steward" ? (
                      <FormGroup>
                        <FormLabel className="form-label-text">
                          Select Collection
                        </FormLabel>
                        <Select
                          name="stewardUsage"
                          // value={this.state.chosenStewardUsage}
                          options={stewardUsageOptions}
                          placeholder=" Select Stewards Usage Type "
                          onChange={setStewardUsage}
                        />
                      </FormGroup>
                    ) : null}
                    <Button
                      className="btn btn-fill btn-success"
                      onClick={generateFinalList}
                    >
                      Submit Selected{" "}
                      {user == "steward" ? "Stewards" : "Patrons"}
                    </Button>
                  </div>
                )}

                {filteredData.length == 0 && (
                  <center>
                    <label>No Results Found!!</label>
                  </center>
                )}
              </div>
            }
          />
        </div>
      )}
    </div>
  );
};

export default SearchByKeyword;
